let bgcolor;
function readColor() {
    bgcolor = prompt("Enter background color:");
    if (bgcolor){
        document.body.style.backgroundColor = bgcolor;
    }else{
        document.body.style.backgroundColor = "lightgreen";
    }
}
function emoji(){
    let emoji = prompt("Enter open or close:");
    const image1 = document.getElementById('myimage');
    const image2 = document.getElementById('myimage');
    const image3 = document.getElementById('myimage');
    if (emoji == "close"){
        image1.src = "data:image/jpeg;base64,";

    }
    else if (emoji == "open"){
        
        image2.src = "data:image/jpeg;base64,";
    }
    else{
        alert("Please enter open or close");
        image3.src = "data:image/png;base64,"
    }
}
function reset(){
    document.body.style.backgroundColor = "white";
    document.getElementById("myimage").src="open";
}